#include <cstddef>
#include <cstdint>

#include "/src/xpdf-4.05/xpdf/PDFDoc.h"
#include "OutputDev.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *Data, size_t Size) {
    // Create necessary parameters for `PDFDoc::displayPages`
    OutputDev *outputDev = new OutputDev();
    int firstPage = 1;
    int lastPage = 1;
    double hDPI = 72.0;
    double vDPI = 72.0;
    int rotate = 0;
    bool useMediaBox = false;
    bool crop = false;
    bool printing = false;
    int *infiniteLoop = nullptr;
    void *otherParams = nullptr;

    // Create a PDFDoc instance
    PDFDoc *doc = new PDFDoc(Data, Size);

    // Call `PDFDoc::displayPages`
    doc->displayPages(outputDev, firstPage, lastPage, hDPI, vDPI, rotate, useMediaBox, crop, printing, infiniteLoop, otherParams);

    // Cleanup
    delete doc;
    delete outputDev;

    return 0;
}
